deck_description:
Going 2nd deck.

&nbsp;

If you lose the dice roll and have to go first then just scoop and go 2nd.

This is an attempt at a pure P.U.N.K. list, using Jet Synchron and Halq to enable Hot Red Dragon Archfiend King Calamity. This deck has two main lines: opening one of the P.U.N.K. starters with an extender (Red Hared Hasty Horse, Gizmek Orochi, or Psychic Wheeleder), or opening a P.U.N.K. starter with no extender. I didn't include Ash Blossom, Nibiru, or Crossout Designator in this list to keep it semi-budget, but I will upload another list with a more optimized build using those cards.

&nbsp;

Our starters are Ze Amin, Sharakusai and another P.U.N.K. in hand, Emergency Teleport, Ogre Dance, or Foxy Tune. If we open Ze Amin, we search Foxy Tune after summoning, use Foxy Tune to summon Sharakusai, and continue with the combo listed below. If we open Emergency Teleport we can do the same thing, searching Ze Amin, or we can summon Sharakusai if we have a P.U.N.K. in hand. Ogre Dance searches either Ze Amin or Sharakusai, and Foxy Tune does the same. Make sure to use your Ogre Dance for a search before continuing the combo, as we will need a Dark in grave. Also, always use your Ze Amin search, grabbing Ogre Dance if we already have Foxy Tune.

Once we have Sharakusai and another P.U.N.K. in hand or on field, we want to use our extenders. First summon  Cupid Fore, then Psychic Wheeleder, if you have them. Activate Sharakusai to fusion summon Rising Carp using a monster in hand, or on field if you don't have a monster in hand. Activate Rising Carp to summon a Deer Note and a Madame Spider or Wa Gon from deck (preferably Madame Spider). If you only opened one extender, normal summon a P.U.N.K. from hand, then link off the extender and the P.U.N.K. for your Halqifibrax, using Halq to search Jet Synchron. Syncho summon Chaos Ruler using Deer Note and your other P.U.N.K. on field, activating Deer Note, then Chaos Ruler. Summon Sharakusai off of Deer Note and add a monster to hand off of Chaos Ruler (preferably a hand trap). Synch off Chaos Ruler and Jet Synchron for Hot Red Dragon Archfiend Abyss, then use Jet Synchron in grave to return it to the field, and use Chaos Ruler's effect to return it to the field, as well.  Now, on your opponent's turn, you should have at least one trap (searched off of Madame Spider), one hand trap (from Chaos Ruler, if we're lucky), Sharakusai's ability to synch into Amazing Dragon for a few bounces, Hot Red Dragon Archfiend Abyss's effect negation, and Halq into Formula Synchron into Hot Red Dragon Archfiend King Calamity to stop your opponent form activating cards and effects.

&nbsp;

Our line is much less exciting if we don't open any extenders. We still make Rising Carp off of Sharakusai, but instead of going for Halqifibrax and Chaos Ruler, we make Draco Berserker of the Tenyi, summoning back Sharakusai off of Deer Note. We are playing three Pot of Avarice to shuffle back our P.U.N.K.s; specifically Rising Carp, which we can use on following turns to make another Amazing Dragon or Psychic End Punisher. If we get Ash Blossomed, we can sometimes still extend a bit. Gossip Shadow is in the deck to allow for followup after getting Ashed on our Ze Amin/E-Tele/Foxy Tune as long as we have a Psychic Wheeleder and a Lv 3 P.U.N.K. in hand. If we know that the opponent is playing Nibiru, and we open Psychic Wheeleder and an Emergency Teleport or Foxy Tune, we can make Gossip Shadow before committing to our Draco Berserker line.

&nbsp;

With a Red Hared Hasty Horse, we can instead make Chaos Ruler or Draco Berserker, and with Gizmek Orochi we can make a level 11 instead. Satellite Warrior is in our extra deck so that if we get stuck on Halqifibrax with a level 8 on field or a Gizmek Orochi in grave, we can make Satellite Warrior off of our Formula Synchron summon. Unfortunately, without Crossout Designator we don't have much play through Nibiru. If you have any ideas on what would help this deck to survive a Nibiru, please comment down below.

&nbsp;

That's all I have for this deck, I hope you like it and please let me know if there are any changes you would make!

Zefra plus 2 powerful pendulum engines that helps it to... Scythe lock?

&nbsp;

Today i wanted to rock with symphonycs but was surprised by the synergy it has with this kind of zefra variation. The greatest synergy is with <a data-name="Guitariss">Guitariss, he is a level 3 tuner has a scale of 0 and even can bounce your own scales. pretty nice. </a>

The D/D engine is searchable with your standard Crocodragon-Oracle combo and it possibilities easy acess to halq and, thus, scythe lock.

&nbsp;

In a good hand you can make Apollousa 4 negates + scythe lock (baronne included) + Zefra omni negate. Still, i need to test more and see what cards i can cut from the extra deck, because there's some situations were you can make the croco-oracle search become recharger-oracle or idk, maybe masquerena is good for winmore?

&nbsp;

So in the end i stand here just saying how much it was cool to try warping around the engines. XD

&nbsp;

&nbsp;

GLHF

Handtrap oriented. Control and negate.

&nbsp;

Number 15th slot in extra deck is Navy dragon mech. Dont know why the website doesnt add.
